import React, { Component } from "react";

class Skills extends Component {
  constructor(props) {
    super(props);

    this.state = { isShowing: false };

    this.onClickEvent = () => {
      this.props.deleteSkill();
      this.setState({ isShowing: false });
    };
  }

  render() {
    return <div>{this.props.skills}</div>;
  }
}

export default Skills;
